import React from 'react';
import Technologies from './Technologies/Technologies.js'
import './App.css';

const App = () => {
  return (
    <div>
      <Header />
      <Technologies />
    </div>
  );
}

const Header = () => {
  return (
    <div>
      <a href="#">Home</a>
      <a href="#">News feed</a>
      <a href="#">Message</a>
    </div>
  );
}

export default App;
